import React from 'react';

const LandingPage = () => {
  return (
    <div className="max-w-md mx-auto p-4 sm:p-6 md:p-8">
      <h2 className="text-2xl font-bold mb-4 text-center">Welcome to Our Site</h2>

      <div className="aspect-w-16 aspect-h-9 mb-4">
        <iframe
          src="https://www.youtube.com/watch?v=Q1Xl1HHL1io?autoplay=1&mute=1"
          title="YouTube video player"
          frameBorder="0"
          allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
          allowFullScreen
          className="w-full h-full"
        ></iframe>
      </div>

      <p className="text-base leading-relaxed">
        Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nullam in dui mauris. 
        Vivamus hendrerit arcu sed erat molestie vehicula. Sed auctor neque eu tellus 
        rhoncus ut eleifend nibh porttitor. Ut in nulla enim.
      </p>
    </div>
  );
};

export default LandingPage;
